    if num < 2:
        return False
    for i in range(2, int(num ** 0) + 1):
        if num % i == 0:
            return False
    return True

def count_prime_numbers(start: int, end: int) -> Tuple[int, int]:
    count = 0
    prime_sum = 0
    for num in range(start, end + 1):
        if is_prime(num):
            count += 1
            prime_sum += num
    return (count, prime_sum)

